import React, { useEffect, useState } from "react";
import "./style.css";
const Navbar = () => {
  const [user, setUser] = useState([]);

  const getUser = async () => {
    const response = await fetch("https://jsonplaceholder.typicode.com/posts");
    setUser(await response.json());
  };

  useEffect(() => {
    getUser();
  }, []);
  return (
    <>
      
        <section className="section-div ">
          <div className="first-s-div">
            Hi reader.
            <img src="" alt="" />
            <span className="f-s-d-s">Here's Your News!</span>
          </div>
          <div className="second-s-div">
            <h3>View Toggel</h3>
            <button className="s-s-d-button">
              <img src="\images\horizontal_split.svg" alt="" />
            </button>
            <button className="s-s-d-button">
              <img src="\images\vertical_split.svg" alt="" />
            </button>
          </div>

          <div className="third-s-div">
            Have a Feedback?
            <button className="t-s-d-button">
              <span>We're Listening!</span>
            </button>
          </div>
        </section>
        {/* <div className="news-div">
                <div className="news-c-div">
                <div className="img-div"><img src="\images\close.svg" alt="" /></div> 
                 <h1>helo</h1>
                 <p>pre</p>
                 </div>
                 </div>  */}
               
                            <div className="container-fluid mt-5">
                            <div className="row text-center">
                            {
                     user.map((curEle) => {
                         return (
                                <div className="col-10 col-md-4 mt-5">
                                <div className="card p-2">
                                   <div className="d-flex align-items-center">
                                <div className="ml-3 w-100">
                                              <h4 className="mb-0 mt-0 textLeft">{cur} </h4>
                                          {/* <span className="text-left">{type }</span> */}
                              <div className="p-2 mt-2  d-flex justify-content-between rounded  ">
                                       <div className="d-flex flex-column">
                                   <span>{curEle.body}</span> </div>
                                                  </div>
                                                
                                              </div>
                                       </div>
                                    </div>
                              </div>
              )

            })
        }
                                </div>
          
                            </div>
          
    </>
  )
    }

export default Navbar ;
